import React from 'react';

import Form from '../../components/form';
import Layout from '../../components/main/Layout';

export default function LoginPage() {
    return (
        <Layout>
            <form className="w-full sm:w-[500px]">
                <h1 className='text-center'>Let's Chat!</h1>
                <h5 className='text-gray-500  text-sm'>Register</h5>
                <Form.FormInput className="py-2" placeholder="Username" />
                <Form.FormInput
                    type="email"
                    className="py-2"
                    placeholder="Email"
                />
                <Form.FormInput
                    type="password"
                    className="py-2"
                    placeholder="Password"
                />
                <Form.Button title="Submit" className='w-full' />
            </form>
        </Layout>
    );
}
